-- Load Demo Data Script
-- ====================
-- This script truncates all demo data tables and reloads them with fresh demo data.
-- 
-- Usage:
--   psql -d tjk_stablemate -f load-demo-data.sql
--
-- What it does:
--   1. Truncates all tables (expenses, notes, horses, users, etc.)
--   2. Inserts demo data including:
--      - 2 owners (EMRAH KARAMAZI, HAYRETTİN KARAMAZI)
--      - 1 trainer (ENGİN KARATAŞ)
--      - Multiple horses with race history, gallops, registrations
--      - Expenses and notes for the last 12 months
--
-- Note: This will DELETE all existing data in the tables listed below.

SET statement_timeout = 0;
SET lock_timeout = 0;
SET idle_in_transaction_session_timeout = 0;
SET client_encoding = 'UTF8';
SET standard_conforming_strings = on;
SET check_function_bodies = false;
SET client_min_messages = warning;
SET row_security = off;

BEGIN;

-- Truncate tables in correct order (child tables first, respecting foreign keys)
TRUNCATE TABLE expenses CASCADE;
TRUNCATE TABLE horse_notes CASCADE;
TRUNCATE TABLE horse_gallops CASCADE;
TRUNCATE TABLE horse_location_history CASCADE;
TRUNCATE TABLE horse_registrations CASCADE;
TRUNCATE TABLE horse_race_history CASCADE;
TRUNCATE TABLE horses CASCADE;
TRUNCATE TABLE stablemate_trainers CASCADE;
TRUNCATE TABLE trainer_profiles CASCADE;
TRUNCATE TABLE stablemates CASCADE;
TRUNCATE TABLE owner_profiles CASCADE;
TRUNCATE TABLE users CASCADE;


COMMIT;

-- Demo data loaded successfully!
